import React from 'react';
import './App.css';
import Enter from "./Enter";

const onChange = e => {
    const { name, value } = e.target;
    setInputs({
        ...inputs,
        [name]: value
    });
};

function App() {
  return (
    <>
      <Enter onChange={onChange}></Enter>
    </>
  );
}

export default App;
